import React, { useState, useEffect } from "react";

const Body = () => {
  const [fishList, setFish] = useState("");

  useEffect(() => {
    fetch("https://www.fishwatch.gov/api/species")
      .then((res) => res.json())
      .then(
        (fish) => {
          console.log(fish[6]);
          setFish(fish[3]["Image Gallery"][0].src);
        },
        (error) => {
          console.log("error");
        }
      );
  }, []);

  return (
    <div>
      <h1> {fishList}</h1>
      <img src={fishList} alt="fish" />
    </div>
  );
};

export default Body;
